using AlgorithmsApp.String;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Runtime.Intrinsics.X86;
using System.Text;
using System.Threading.Tasks;

namespace TestProject
{
    public class LetCodeChallengesTests
    {
        [Theory]
        [InlineData("()", true)]
        [InlineData("()[]{}", true)]
        [InlineData("(]", false)]
        public void ValidateValidParentheses(string input, bool expected)
        {
            bool actual = LetCodeChallenges.ValidParentheses(input);
            Assert.Equal(expected, actual);
        }
        [Fact]
        public void ValidateThreeSum_Length_Less_Than_Three()
        {
            int[] nums = new int[] { 0, 1 };
            IList<IList<int>> expected = new int[][] { };

            IList<IList<int>> actual = LetCodeChallenges.ThreeSum(nums);
            Assert.Equal(expected.Count, actual.Count);
            for (int i = 0; i < expected.Count; i++)
            {
                Assert.Equal(expected[i], actual[i]);
            }

        }

        [Fact]
        public void ValidateThreeSum_Not_Coincidence()
        {
            int[] nums = new int[] { 0, 1, 1 };
            IList<IList<int>> expected = new int[][] { };

            IList<IList<int>> actual = LetCodeChallenges.ThreeSum(nums);
            Assert.Equal(expected.Count, actual.Count);
            for (int i = 0; i < expected.Count; i++)
            {
                Assert.Equal(expected[i], actual[i]);
            }

        }

        [Fact]
        public void ValidateThreeSum_One_Coincidence()
        {
            int[] nums = new int[] { 0, 0, 0 };
            IList<IList<int>> expected = new int[][] { new int[] { 0, 0, 0 } };

            IList<IList<int>> actual = LetCodeChallenges.ThreeSum(nums);
            Assert.Equal(expected.Count, actual.Count);
            for (int i = 0; i < expected.Count; i++)
            {
                Assert.Equal(expected[i], actual[i]);
            }

        }

        [Fact]
        public void ValidateThreeSum_Two_Coincidences()
        {
            int[] nums = new int[] { -1, 0, 1, 2, -1, -4 };
            IList<IList<int>> expected = new int[][] { new int[] { -1, -1, 2 }, new int[] { -1, 0, 1 } };

            IList<IList<int>> actual = LetCodeChallenges.ThreeSum(nums);
            Assert.Equal(expected.Count, actual.Count);
            for (int i = 0; i < expected.Count; i++)
            {
                Assert.Equal(expected[i], actual[i]);
            }

        }

        [Fact]
        public void ValidateThreeSum_Fail_Coincidences()
        {

            int[] nums = new int[] { -1, 0, 1, 2, -1, -4, -2, -3, 3, 0, 4 };
            IList<IList<int>> expected = new int[][] { new int[] { -4, 0, 4 }, new int[] { -4, 1, 3 }, new int[] { -3, -1, 4 }, new int[] { -3, 0, 3 }, new int[] { -3, 1, 2 }, new int[] { -2, -1, 3 }, new int[] { -2, 0, 2 }, new int[] { -1, -1, 2 }, new int[] { -1, 0, 1 } };
            IList<IList<int>> actual = LetCodeChallenges.ThreeSum(nums);
            Assert.Equal(expected.Count, actual.Count);
            for (int i = 0; i < expected.Count; i++)
            {
                Assert.Equal(expected[i], actual[i]);
            }

        }
